import { BehaviorSubject } from "rxjs";

const rangeMinMaxValues = new BehaviorSubject([]);
const rangeEmmiter = new BehaviorSubject(rangeMinMaxValues);

export default {
  rangeMinMaxValues,
  rangeEmmiter,
};
